import React from "react";
import { useLocation } from "react-router-dom";

function TableEntry(){
    const location = useLocation()
    const {task, goal} = location.state || {}
    return (
        <h1> TASK: {task} Goal {goal} </h1>
    )

}

export default TableEntry;
